import React, { useState, useEffect } from 'react';
import './styles.css'; // Import the CSS file

const buttonPositions = [
  ['array1string1', 'array2string2', 'array1string3', 'array3string4'],
  ['array3string1', 'array3string2', 'array2string3', 'array2string4'],
  ['array4string1', 'array1string2', 'array3string3', 'array4string4'],
  ['array2string1', 'array4string2', 'array4string3', 'array1string4'],
];

const buttonsByArray = [
  ['array1string1', 'array1string2', 'array1string3', 'array1string4'],
  ['array2string1', 'array2string2', 'array2string3', 'array2string4'],
  ['array3string1', 'array3string2', 'array3string3', 'array3string4'],
  ['array4string1', 'array4string2', 'array4string3', 'array4string4'],
];

const arrayColors = ['maroon', 'green', 'navy', 'purple'];

const App = () => {
  const [selectedItems, setSelectedItems] = useState(new Set());
  const [checkButtonEnabled, setCheckButtonEnabled] = useState(false);
  const [matchedArrays, setMatchedArrays] = useState(new Set());
  const [shouldShake, setShouldShake] = useState(false);
  const [gridLayout, setGridLayout] = useState(buttonPositions);
  const [matchedArray, setMatchedArray] = useState(null); // Define matchedArray state
  useEffect(() => {
    setCheckButtonEnabled(selectedItems.size === 4);
  }, [selectedItems]);

  useEffect(() => {
    if (shouldShake) {
      const timer = setTimeout(() => setShouldShake(false), 500);
      return () => clearTimeout(timer);
    }
  }, [shouldShake]);

  const handleButtonClick = (item) => {
    if (selectedItems.has(item)) {
      const updatedSelectedItems = new Set(selectedItems);
      updatedSelectedItems.delete(item);
      setSelectedItems(updatedSelectedItems);
    } else if (selectedItems.size < 4) {
      setSelectedItems(new Set(selectedItems).add(item));
    }
  };

  const isItemSelected = (item) => {
    return selectedItems.has(item);
  };

  const handleCheckButtonClick = () => {
    const selectedArray = buttonsByArray.find(array => {
      return [...selectedItems].every(item => array.includes(item));
    });

    if (selectedArray) {
      console.log('All selected items belong to the same array:', selectedArray);
      const matchedIndex = buttonsByArray.findIndex(array => array === selectedArray);
      setMatchedArrays(new Set(matchedArrays).add(matchedIndex));
      setSelectedItems(new Set());
      setShouldShake(false);

      // Remove the matched array from the grid layout
      const remainingArrays = gridLayout.filter((_, index) => index !== matchedIndex);
      setGridLayout(remainingArrays);

      // Update the display with matched array name and strings
      const arrayName = `Array ${matchedIndex + 1}`;
      const arrayStrings = selectedArray.map((str, index) => (
        <li key={index}>{str}</li>
      ));
      setMatchedArray({ name: arrayName, strings: arrayStrings });
    } else {
      console.log('Selected items do not belong to the same array');
      setMatchedArrays(new Set());
      setShouldShake(true); // Ensure shouldShake is set to true for incorrect arrays
    }
  };

  return (
    <div>
      <div className="heading-wrapper"><h1>♥ Connections ♥</h1></div>
      <div className={`grid-container ${shouldShake ? 'shake-animation' : ''}`}>
        {/* Transposing the grid */}
        {gridLayout[0].map((_, columnIndex) => (
          <div key={columnIndex} className="grid-column">
            {gridLayout.map((row, rowIndex) => {
              const item = row[columnIndex];
              const arrayIndex = buttonsByArray.findIndex(array => array.includes(item));
              const isMatched = matchedArrays.has(arrayIndex);
              return (
                <button
                  key={rowIndex}
                  className={`${isItemSelected(item) ? 'selected' : ''} ${isMatched ? 'matched' : ''}`}
                  style={{
                    backgroundColor: isMatched ? arrayColors[arrayIndex] : null,
                  }}
                  onClick={() => handleButtonClick(item)}
                  disabled={isMatched}
                >
                  {item}
                </button>
              );
            })}
          </div>
        ))}
      </div>
      <div>
  {/* Your existing JSX for grid */}
</div>

      <div className="check-button-container">
        <button
          className="check-button"
          disabled={!checkButtonEnabled}
          onClick={handleCheckButtonClick}
        >
          Check
        </button>
      </div>
      <h2>Selected Items</h2>
      <ul>
        {[...selectedItems].map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
};

export default App;
